import React, { Component } from 'react';


class App extends Component {
    state = {
        isLoading: true,
        groups: [],
    };

    async componentDidMount() {
        fetch("https://localhost:8080/quiz").then(res => res.json())
            .then(result => {
                this.setState({ groups: result, isLoading: false });
            }
            );
        // const body = await response.json();
        console.log(response)

    }

    render() {

        if (this.state.isLoading) {
            return <p>Loading...</p>;
        }
        return (
            <div className="App">
                <header className="App-header">
                    <div className="App-intro">
                        <h2>JUG List</h2>
                        {this.state.groups.map(group =>
                            <div key={group.id}>
                                {group.name}
                            </div>
                        )}
                    </div>
                </header>
            </div>
        );
    }
}
export default App;
